// Functional Components
const PrimeraApp = () => {

    // Solo se puede retornar un elemento a la vez, pero usando un fragment puedes adjuntar varios elementos en uno solo.
    return (
        // Esto es un fragment
        <> 
             <h1>Hola Mundo</h1>
            <p>Mi Primera Aplicacion en React</p>
        </>
    );

}

export default PrimeraApp;
